import { useLocation } from 'react-router-dom';

import Message from '../components/Message';

import styles from './Products.module.css'

function Products() {

    const type = "";
    const message = "";

    return(
        <div className={styles.products}>
            {<Message type={type} text={message}/>}
            <h1>Products</h1>
            <hr/>
        </div>
    );
}

export default Products;
